DISCLOSURE_INFO:
{
  "criminalCharges" : [ {
    "Charges" : "CHARGE: UNAUTHORIZED USE OF AUTOMOBILE 1) SINGLE (1) COUNT 2) MISDEMEANOR 3)PLEA OF INNOCENT NOT INVESTMENT RELATED",
    "Charge Type" : "MISDEMEANOR",
    "Disposition" : "A) DISPOSITION: DISMISSED B) 6/27/1969  I HAVE ATTEMPTED TO OBTAIN COURT RECORDS OF THE EVENT IN QUESTION WHICH OCCURRED ON 6/26/1969. ACCORDING TO A WRITTEN COMMUNICATION DATED JUNE 6,2000 FROM BOSTON MUNICIPAL COURT NO COURT RECORD CAN BE FOUND. I WAS A JUVENILE AT THE TIME OF THE EVENT(AGE 16. I BELIEVE THAT MY ATTORNEY AT THAT TIME REQUESTED ALL RECORDS OF THE EVENT BE EXPUNGED."
  } ],
  "Broker Comment" : "ON 6/26/1969 TWO FRIENDS ASKED ME TO HELP MOVE PIECES OF FURNITURE USING AUTOMOBILE SAME TWO FRIENDS HAD BORROWED FROM ANOTHER FRIEND. IN PROCESS OF MOVING FURNITURE, WE WERE PULLED OVER BY BOSTON POLICE. POLICE INFORMED US VEHICLE WAS REPORTED AS STOLEN. WE WERE ARRESTED. I WAS 16 YEARS OLD AT THE TIME.  THE CAR WAS NOT STOLEN. TURNS OUT FRIEND(CAR OWNER),LIVING WITH PARENTS, LEFT FOR A FEW DAYS AND NEGLECTED TO TELL FATHER HE ALLOWED FRIENDS TO USE VEHICLE. FATHER, NOT KNOWING SON HAD ALLOWED USE OF VEHICLE, ASSUMED MISSING CAR HAD BEEN STOLEN AND, IN ERROR, REPORTED SAME TO BOSTON POLICE.  IN BOSTON MUNICIPAL COURT COURT NEXT MORNING(6/27/1969)THIS EVIDENCE CAME OUT. ALL INVOLVED WERE FOUND INNOCENT AND DISMISSED IMMEDIATELY WITHOUT CHARGE."
}
